import React from 'react';
import {Link} from 'react-router-dom';

const Navbar = () => {
    return (
        <div>
            <nav className="nav-extended">
                <div className="blue darken-3">
                    <a href="/" className="brand-logo">Employees Search</a>
                    <a href="#" data-activates="main-menu" className="button-collapse show-on-large"><i class="fa fa-bars"></i></a>
                    <ul id="nav-mobile" className="right hide-on-small-only">
                        <li><Link to= "/"><i class="fa fa-users"></i>Search</Link></li>

                    </ul>
                </div>
                <ul class="sidenav" id="main-menu">
                </ul>
            </nav>
        </div>
    )
}

export default Navbar
